import React from 'react';
import './ModalNav2.css'

const ModalNavv = ({active2, setActive2, children2}) => {
    return (
        <div className={active2 ? "modal active2" : "modal2"} onClick={() => setActive2(false)}>
            <div className={active2 ? "modal-cont active2" : "modal-cont2"} onClick={e => e.stopPropagation()}>
                {children2}
            </div>
        </div>
    );
};

export default ModalNavv;
